import logo from './logo.svg';
import './App.css';
import React, { Suspense } from 'react';
import About from './component/About';
import * as THREE from 'three';
import { Canvas } from 'react-three-fiber';
import circleImg from './assets/circle.png'


function Points() {
  return(
    <points>
      <bufferGeometry attach={"geometry"}></bufferGeometry>
    </points>
  );
}
function AnimationCanvas() {
  return (
    <Canvas
      colorManagment={false}
      camera={{ position: [100, 10, 0], fov: 75 }}
    >
      <Suspense fallback={null}>
        <Points />
      </Suspense>

    </Canvas>

  );
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Suspense fallback={<div>Loading...</div>}>
          <AnimationCanvas />
        </Suspense>

        <img src={logo} className="App-logo" alt="logo" />
        <img src={logo} className="App-logo-animation" alt="logo" />
        <p>
          Plataforma Open-source Online de Visualización Tridimensional Multivariable de Bases de Datos Científicos
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Visualizar Bases de Datos
        </a>
        <div style={{ textAlign: "center" }}>
          <h1>REACTJS CSV IMPORT EXAMPLE </h1>
          <form>
            <input type={"file"} accept={".csv"} />
            <button>IMPORT CSV</button>

          </form>
        </div>
        <div><About /></div>
      </header>

    </div>
  );
};
export default App;
